						return;
					}
					Error("System error: \"" + value + "\" is operation");
				}
			}
			
			List<ExprStackObject> exprStack;
			
			ExprStackObject Pop()
			{
				var ret = exprStack[exprStack.Count - 1];
				exprStack.RemoveAt(exprStack.Count - 1);
				return ret;
			}
			
			void Push(ExprStackObject value)
			{
				exprStack.Add(value);
			}
			
			public override void Eval()
