						case "+":
							right = Pop();
							left = Pop();
							right.Calc();
							left.Calc();
							Push(left.value + right.value);
							break;
							
						case "-":
							right = Pop();
							left = Pop();
							right.Calc();
							left.Calc();
							Push(left.value - right.value);
							break;
							
						case "*":
